widgets.script:
prism.jumpToDashboard(widget, {
  drillToDashboardNavigateTypePivot: 2,
  drilledDashboardDisplayType: 3,
  excludeFilterDims: "[DIM_USER.USER_LAST_ACTIVITY_AT (Calendar)]"
})

// set colors
const default_text = '#5B6372'; // dark grey text in dashboard
const link_text = '#33698b'; // wmx link blue

// each obj has a target of cells to style
// and a handler fn to apply the style
const styles = [
    {
        target: { type: ['value'] },
        handler: function setValueStyle(metadata, cell) {
            cell.style = cell.style || {};
            cell.style.color = default_text;
        }
    },
    {
        target: {
            type: ['member'],
            rows: [{ title: 'User Email' }]
        },
        handler: function setUserEmailStyle(metadata, cell) {
            cell.style = cell.style || {};
            cell.style.color = link_text;
        }
    },
    {
        target: {
            type: ['member'],
            rows: [{ title: 'User Name' }]
        },
        handler: function setUserNameStyle(metadata, cell) {
            cell.style = cell.style || {};
            cell.style.color = link_text;
        }
    },
	{
        target: {
            type: ['member'],
            rows: [{ title: 'Course Name' }]
        },
        handler: function setCourseNameStyle(metadata, cell) {
            cell.style = cell.style || {};
            cell.style.color = link_text;
        }
    },
];

// apply styles
styles.forEach(styler => {
    widget.transformPivot(styler.target, styler.handler);
});
